import React, { Component } from "react";

class Navbar extends Component {
  state = {};
  render() {
    return (
      <div styles={{ backgroundColor: "black" }}>
        <button
          style={{ marginLeft: "10px" }}
          className="btn btn-secondary btn-sm"
        >
          Uusi kalenteri
        </button>

        <button style={{ float: "right" }} className="btn btn-secondary btn-sm">
          Hae
        </button>

        <input
          type="text"
          placeholder="Hae Kalenteria"
          className=""
          style={{ marginRight: "10px", float: "right" }}
        ></input>
      </div>
    );
  }

  getstyles() {
    let styles = "background-color: lightblue";
    return styles;
  }
}

export default Navbar;
